import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LandingPage from 'LandingPage';

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/" component={LandingPage} />
          {/*<Route path="/women" component={Women} />*/}
        </Switch>
      </Router>
    </div>
  );
}

export default App;
